INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(10, 'Apprenez à programmer en Java - 2e édition', 'Cyrille Herby', 'Tutoriel', 'Vous aimeriez apprendre à programmer en Java, mais vous débutez dans la programmation ? Pas de panique ! Vous avez devant vous un cours conçu pour les débutants qui souhaitent se former à Java, le langage de programmation incontournable des professionnels ! Ici, le seul pré-requis est de savoir allumer son ordinateur ! C''est un cours de difficulté progressive, du B.A.-BA aux notions avancées. Des milliers de débutants se sont formés avant vous à Java grâce à ce cours ! Ce livre est destiné aux étudiants dans le domaine des nouvelles technologies qui recherchent un support de cours, aux développeurs en entreprise qui souhaitent programmer rapidement et efficacement, mais aussi à tous ceux qui désirent se former ou se convertir à l''informatique logicielle.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(11, 'Cinquante nuances de Grey', 'E L James', 'Roman', 'Anastasia Steele, étudiante en littérature, a accepté la proposition de son amie journaliste de prendre sa place pour interviewer Christian Grey, un jeune et richissime chef d’entreprise de Seattle. Dès le premier regard, elle est à la fois séduite et intimidée. Convaincue que leur rencontre a été désastreuse, elle tente de l''oublier, jusqu''à ce qu''il débarque dans le magasin où elle travaille à mi-temps et lui propose un rendez-vous. Ana est follement attirée par cet homme. Lorsqu''ils entament une liaison passionnée, elle découvre son pouvoir érotique, ainsi que la part obscure qu’il tient à dissimuler... Romantique, libératrice et totalement addictive, la trilogie Fifty Shades, dont Cinquante nuances de Grey est le premier volume, vous obsédera, vous possédera et vous marquera à jamais.  Le roman le plus vendu dans le monde en 2012.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(12, 'Java Pour les Nuls, Nouvelle édition', 'Barry BURD', 'Tutoriel', 'Grâce à se livre, vous allez rapidement écrire rapidement vos premières applets Java, sans pour autant devenir un gourou de la programmation objet. Rassurez-vous, on ne vous assommera pas avec toutes les subtilités du langage Java, mais vous posséderez rapidement les bases nécessaires pour utiliser la panoplie d''outils du parfait programmeur Java.    Au programme : Les bases du langage Java Les variables Les constantes Les opérateurs Mise en place des structures de contrôles Débuter en programmation orientée objet Les exceptions Construction d''une application Java complète', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(13, 'Spring par la Pratique Spring 2.5 et 3.0', 'Julien Dubois', 'Tutoriel', 'Tirez le meilleur parti de Java EE avec Spring !Cet ouvrage montre comment développer des applications Java EE professionnelles performantes à l''aide du framework Spring. L''ouvrage présente les concepts sur lesquels reposent Spring (conteneur léger, injection de dépendances, programmation orienté aspect) avant de détailler les différentes facettes du développement d''applications d''entreprise avec Spring : couche présentation, persistance des données et gestion des transactions, intégration avec d''autres applications et sécurité applicative', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(14, 'Divergente 1', 'Veronica Roth', 'Roman', 'Tris vit dans un monde post-apocalyptique où la société est divisée en cinq factions. À 16 ans elle doit choisir sa nouvelle appartenance pour le reste de sa vie. Cas rarissime, son test d''aptitudes n''est pas concluant. Elle est divergente. Ce secret peut la sauver... ou la tuer.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(15, 'Nos étoiles contraires', 'John Green', 'Roman', 'Hazel, 16 ans, est atteinte d''un cancer. Son dernier traitement semble avoir arrêté l''évolution de la maladie, mais elle se sait condamnée. Bien qu''elle s''y ennuie passablement, elle intègre un groupe de soutien, fréquenté par d''autres jeunes malades. C''est là qu''elle rencontre Augustus, un garçon en rémission, qui partage son humour et son goût de la littérature. Entre les deux adolescents, l''attirance est immédiate. Et malgré les réticences d''Hazel, qui a peur de s''impliquer dans une relation dont le temps est compté, leur histoire d''amour commence... les entraînant vite dans un projet un peu fou, ambitieux, drôle et surtout plein de vie. Élu " Meilleur roman 2012 " par le Time Magazine ! Prix de L''Échappée Lecture 2014 de la Nièvre Prix du Jury littéraire Giennois 2014 Prix Plaisirs de lire 2014, département de l''Yonne Prix des Embouquineurs 2014', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(16, 'Hunger Games, Tome 3 : La révolte', 'Suzanne COLLINS', 'Roman', 'Katniss a survécu par miracle à ses deuxièmes Hunger Games. Sauvée par un commando venu du district 13, elle réapprend à vivre dans les souterrains de ce district mythique. Elle y retrouve sa mère, sa petite soeur Prim et même Gale, Haymitch, Plutarch et certains des tributs, aussi mal en point qu''elle. Une fois remise sur pieds, Katniss accepte pourtant de repartir sur le devant de la scène. Elle sera le Geai Moqueur, le visage de la résistance contre le Capitole, organisée par le district 13 et son président, l''étrange Coin. La jeune fille espère ainsi pouvoir retourner dans le Capitole pour assassiner le président Snow et sauver Peeta. Mais avant d''accomplir sa mission, Katniss doit répondre à une question cruciale : doit-elle exécuter sa vengeance ou bien chercher la vraie source du mal ? De son choix dépend l''avenir des districts et la survie de l''espoir...', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(17, 'Le Chat - Tome 19 - Le Chat passe à table ', 'Philippe Geluck', 'Bande Dessinée', 'Depuis qu''il est redescendu parmi nous (par minou ?) après avoir endossé le rôle de Dieu, Le Chat revient à sa préoccupation première : nous mettre les zygomatiques en feu. Le Chat balance et flingue à tout va : il passe à table, crache le morceau, met les bouchées doubles et n''y va pas avec le dos de la cuillère. Avec ce dix-neuvième opus en forme de coffret, Geluck nous offre le meilleur de sa production inédite des quatre dernières années. Dessins, strips et gravures jamais publiés dans la presse nous dévoilent l''inépuisable créativité de cet auteur prolifique dont la liberté de ton n''a jamais été aussi grande qu''aujourd''hui. Selon le tempérament de chacun, LE CHAT PASSE À TABLE se déguste ou se dévore. Une fois de plus, Le Chat ne recule devant aucun procédé pour nous plier en deux, car, comme il le dit très justement : la faim justifie les moyens.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(18, 'One piece - Edition originale ', 'Eiichiro Oda', 'Manga', 'Tandis que la vérité éclate sur la tragédie de Dressrosa, les événements prennent une tournure totalement différente de ce que Law avait imaginé. En effet, nos héros s orientent petit à petit vers une guerre totale contre Doflamingo et ses sbires... Les aventures de Luffy à la poursuite du One Piece continuent !', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(19, 'Le Petit Prince', 'Antoine de Saint-Exupéry', 'Roman', '«Le premier soir, je me suis donc endormi sur le sable à mille milles de toute terre habitée. J''étais bien plus isolé qu''un naufragé sur un radeau au milieu de l''océan. Alors, vous imaginez ma surprise, au lever du jour, quand une drôle de petite voix m''a réveillé. Elle disait : “S''il vous plaît... dessine-moi un mouton !” J''ai bien regardé. Et j''ai vu ce petit bonhomme tout à fait extraordinaire qui me considérait gravement...»', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(20, 'Le Trône de fer l''Intégrale', 'George R-R Martin', 'Roman', 'Le volume 5 de l''intégrale du Trône de fer clôt provisoirement un chapitre important de cette saga désormais célèbre dans le monde entier grâce à la magnifique série télévisée qui a battu des records historiques d''audience.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(21, 'Joe Bar Team - Tome 08', 'Bar2 - Fane', 'Bande Dessinée', 'Au secours, les revoilà !!!  Ils écument les routes depuis un moment : des champions de quartier aussi vantards qu intrépides, la mauvaise foi et le sarcasme élevés au rang d art, avec un sens des trajectoires parfois aléatoire et une carte de fidélité pour l hosto du coin... Vous les avez reconnus ? Eh oui : sortez les bottes de paille, après 4 ans d absence, les cinglés du Joe Bar Team sont de retour ! Jéjé, Paulo, Pierrot sans oublier les anciens reviennent essorer la poignée de gaz pour nous offrir une nouvelle flopée de gags désopilants dont ils ont le secret, fleurant bon l huile - moteur et la gomme brûlée. Sous le regard parfois consterné de Joe... Aux commandes de ce huitième opus, on retrouve un habitué du circuit, puisque c est Fane qui fait son grand retour en signant son cinquième tome au compteur ! Il réalise sans doute son album le plus abouti, aussi drôle que graphiquement jubilatoire, appelé à devenir au moins aussi culte que les précédents pour tous les inconditionnels de la série et ceux qui, si c est possible, ne la connaîtraient pas encore. Préparez-vous : les pleins sont faits, les niveaux sont à ras bord, humour, mauvaise foi et grosse attaque au rendez-vous, alors... GAAAZZ !!!', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(23, 'Où est Charlie', 'Martin HANDFORD', 'Bande Dessinée', 'Avis aux Charliemaniaques : ce coffret étoilé et habillé d''or rassemble, pour la première fois, l''intégralité des aventures de Charlie ! 7 livres brochés en grand format pour partir à la recherche de Charlie à travers le temps et l''espace !', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(24, 'Le roi Arthur', 'Michael Morpurgo', 'Roman', '«C''est une longue histoire, une histoire de grand amour, de grande tragédie, de magie et de mystère, de triomphe et de désastre.C''est mon histoire. Mais c''est l''histoire surtout de la Table ronde où, autrefois, siégeait une assemblée de chevaliers, les hommes les meilleurs et les plus valeureux que le monde ait jamais connus. Je commencerai par le commencement, quand j''étais encore un enfant à peine plus âgé que tu ne l''es aujourd''hui.»', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(25, 'Un avion sans elle ', 'Michel Bussi ', 'Roman', 'Lyse-Rose ou Émilie ? Quelle est l''identité de l''unique rescapée d''un crash d''avion, une fillette de trois mois ? Deux familles, l''une riche, l''autre pas, se déchirent pour que leur soit reconnue la paternité de celle que les médias ont baptisée « Libellule ». Dix-huit ans plus tard, un détective privé prétend avoir découvert le fin mot de l''affaire, avant d''être assassiné, laissant derrière lui un cahier contenant tous les détails de son enquête. Du quartier parisien de la Butte-aux-Cailles jusqu''à Dieppe, du Val-de-Marne aux pentes jurassiennes du mont Terrible, la jeune femme va dénouer les fils de sa propre histoire jusqu''à ce que les masques tombent. Hasards et coïncidences ne sont-ils que les ricochets du destin ? Ou bien quelqu''un, depuis le début, manipule-t-il tous les acteurs de ce drame ?', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(26, 'Un kilo de culture générale', 'Florence Braunstein ', 'Inconnu', 'Une bonne culture générale vaut son pesant de papier. Il lui fallait un poids lourd : la somme des connaissances censées acquises au sortir de l''adolescence, et qui pourtant nous échappent sans cesse, est désormais à votre portée. Littérature, histoire, philosophie, géographie, sciences et arts : ces domaines se croisent ici en bonne harmonie, tant par fragments que comme parties d''un tout. L''expérience de plus de vingt ans d''enseignement nous a permis d''écrire ce guide unique en son genre car il couvre l''ensemble des principales cultures existant dans le monde; il s''étend sur la totalité de l''histoire, de la formation de la Terre à nos jours ; il présente toute les grandes activités culturelles pour chaque période et chaque pays ; sa présentation claire permet tous les choix de lecture : au fil du livre, par périodes historiques, par thèmes ou par pays. Il se veut, sans prétention mais sans fausse modestie, l''ouvrage de culture générale le plus exhaustif, et le plus indispensable à qui veut avoir réponse à tout.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(27, 'Harry Potter a l''ecole des sorciers', 'J. K. Rowling', 'Roman', 'Le jour de ses onze ans, Harry Potter, un orphelin élevé par un oncle et une tante qui le détestent, voit son existence bouleversée. Un géant vient le chercher pour l''emmener à Poudlard, une école de sorcellerie !Voler en balai, jeter des sorts, combattre les trolls : Harry Potter se révèle un sorcier doué. Mais un mystère entoure sa naissance et l''effroyable V..., le mage dont personne n''ose prononcer le nom.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(28, 'Le loup qui découvrait le pays des contes ', 'Orianne Lallemand', 'Truc mignon', 'Cette année, pour le goûter du printemps, Loup veut préparer un gâteau aux pommes. Oui mais... il ne sait pas cuisiner. Le voici donc dans la foret, bien décidé à trouver quelqu''un pour l''aider. Et qui va-t-il rencontrer ? Trois petits cochons, le Petit chaperon rouge, une sorcière... Il faut au moins cela d''aventures pour réaliser le délicieux gâteau de Tatie Rosette !', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(30, 'La Wicca : Guide de pratique individuelle', 'Scott Cunningham ', 'Religion', 'La Wicca, de Scott Cunningham, est considéré connue le meilleur livre sur la tradition ancestrale de la magie blanche. Avec pédagogie, l''auteur nous initie tout d''abord aux principes, aux déités, aux rituels et aux outils qui permettent de se relier magiquement et spirituellement aux énergies de la Terre. Ensuite, pour le volet pratique de la Wicca, des exercices à base de visualisation et de méditation ainsi que des techniques magiques, faciles à réaliser, sont proposés. La dernière partie contient le précieux Livre des ombres, de l''auteur, avec des invocations et des informations essentielles sur les herbes, les huiles, les encens, les cristaux, les runes, etc. Un manuel complet et pratique de magie sacrée érigée en art de vivre.', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(31, 'La demeure des ténèbres', 'Heather Graham', 'Religion', 'L’adolescent surgit de la forêt et s’arrêta au milieu de la route. Il était nu. Et couvert de sang… Le jeune Malachi Smith a-t-il massacré les membres de sa famille à coups de hache ? Sam Hall, le célèbre avocat qui a choisi de le défendre, exclut cette hypothèse : jamais cet adolescent malingre et inoffensif n’aurait pu commettre un crime d’une telle violence. Tout comme il refuse de croire que Malachi ait été – comme tous le murmurent dans les ruelles de la vieille ville de Salem – possédé par le démon… Non, Sam en est persuadé : le véritable meurtrier court toujours, et il doit à tout prix le démasquer. Voilà pourquoi il a accepté l’aide que Jenna Duffy lui propose. Bien sûr, il ne croit pas un seul instant au don que cette rousse incendiaire prétend posséder – et qui lui permettrait de communiquer avec les morts. Mais Jenna est un agent reconnu du FBI. Et puis, comme lui, elle est prête à tout pour faire éclater la vérité…', );
INSERT INTO `book` (`idBook`, `title`, `autor`, `type`, `description`, `image`) VALUES
(32, 'Satan était un ange', 'Karine GIEBEL ', 'Science Fiction', 'Tu sais Paul, Satan était un ange... Et il le redeviendra. Rouler, droit devant. Doubler ceux qui ont le temps. Ne pas les regarder. Mettre la musique à fond pour ne plus entendre. Tic tac... Bientôt, tu seras mort. Hier encore, François était quelqu''un. Un homme qu''on regardait avec admiration, avec envie. Aujourd''hui, il n''est plus qu''un fugitif qui tente d''échapper à son assassin. Qui le rattrapera, où qu''il aille. Quoi qu''il fasse. La mort est certaine. L''issue, forcément fatale. Ce n''est plus qu''une question de temps. Il vient à peine de le comprendre. Paul regarde derrière lui ; il voit la cohorte des victimes qui hurlent vengeance. Il paye le prix de ses fautes. Ne pas pleurer. Ne pas perdre de temps. Accélérer. L''échéance approche. Je vais mourir. Dans la même voiture, sur une même route, deux hommes que tout semble opposer et qui pourtant fuient ensemble leurs destins différents. Rouler droit devant, admirer la mer. Faire ce qu''ils n''ont jamais fait. Vivre des choses insensées. Vivre surtout... Car après tout, pourquoi tenter sans cesse de trouver des explications ?', );

